cy.request({
  method: 'GET',
  url: `${API_BASE_URL}/users`,
  failOnStatusCode: false
}).then(response => {
  expect(response.status).to.eq(200);
  expect(response.body).to.be.an('array');
  cy.log(`Encontrados ${response.body.length} usuários`);
});

cy.request({
  method: 'GET',
  url: `${API_BASE_URL}/tickets`,
  failOnStatusCode: false
}).then(response => {
  // Pode retornar 200 (com array vazio) ou 404 se o endpoint não existir
  expect([200, 404]).to.include(response.status);
  if (response.status === 200) {
    expect(response.body).to.be.an('array');
    cy.log(`Encontrados ${response.body.length} tickets`);
  }
});

cy.request({
  method: 'GET',
  url: `${API_BASE_URL}/rota-inexistente`,
  failOnStatusCode: false
}).then(response => {
  expect(response.status).to.eq(404);
});
